package sidebar

import androidx.compose.desktop.ui.tooling.preview.Preview
import androidx.compose.foundation.Image
import androidx.compose.foundation.layout.*
import androidx.compose.foundation.rememberScrollState
import androidx.compose.foundation.shape.RoundedCornerShape
import androidx.compose.foundation.verticalScroll
import androidx.compose.material.Card
import androidx.compose.material.Divider
import androidx.compose.material.Text
import androidx.compose.runtime.Composable
import androidx.compose.runtime.snapshots.SnapshotStateList
import androidx.compose.ui.Alignment
import androidx.compose.ui.Modifier
import androidx.compose.ui.graphics.Color
import androidx.compose.ui.graphics.ImageBitmap
import androidx.compose.ui.graphics.asComposeImageBitmap
import androidx.compose.ui.text.font.FontWeight
import androidx.compose.ui.unit.dp
import androidx.compose.ui.unit.sp
import org.jetbrains.skia.Bitmap
import java.util.Base64

@Composable
@Preview
fun Sidebar(chats: SnapshotStateList<ChatPreview>) {
    Column(modifier = Modifier.verticalScroll(rememberScrollState())) {
        for (chatPreview in chats) {
            Row(verticalAlignment = Alignment.CenterVertically) {
                val img: ByteArray = Base64.getDecoder().decode("")
                val imageBitMap: ImageBitmap = Bitmap.makeFromImage(org.jetbrains.skia.Image.makeFromEncoded(img)).asComposeImageBitmap()
                Card(modifier = Modifier.width(width = 350.dp).height(50.dp)) {
                    Row {
                        Image(bitmap = imageBitMap, contentDescription = "", alignment = Alignment.CenterStart)
                        Column(verticalArrangement = Arrangement.Center) {
                            Text(fontWeight = FontWeight.Bold, text = chatPreview.title)
                            Text(
                                if (chatPreview.lastMessage.length > 30)
                                    chatPreview.lastMessage.substring(0, 20) + "..."
                                else
                                    chatPreview.lastMessage
                            )
                        }
                    }

                    Box(contentAlignment = Alignment.CenterEnd) {
                        chatPreview.unreadCount?.let {
                            Card(shape = RoundedCornerShape(10.dp), backgroundColor = Color.LightGray) {
                                Text(fontSize = 14.sp, text = it.toString())
                            }
                        }
                    }
                }
            }
            Divider(modifier = Modifier.width(350.dp))
        }
    }
}

data class ChatPreview(
    var title: String,
    var lastMessage: String,
    var unreadCount: Int?
)